import {makeAutoObservable} from "mobx"

class OneUser {
    constructor(id,fn,sn,img,email,mark,countState,isAdmin){
        this._id =  id,
        this._fn = fn,
        this._sn = sn,
        this._img = img,
        this._email = email,
        this._mark = mark,
        this._countState = countState
    }
};



export default class UsersConteiner{
    constructor(){
        this._users = [
           new OneUser(1),
           new OneUser(2)
        ]
        makeAutoObservable(this)
    }


    setUsers(users){
        this._users = users
    }

    get users(){
        return this._users
    }

    

}
